    false,nt"url": null,nt"notes": "A first-surface elevation map was produced
    cooperatively from remotely sensed, geographically referenced elevation measurements
    collected by the U.S. Geological Survey (USGS) and National Aeronautics and Space
    Administration (NASA) on September 07-09, 2001. Elevation measurements were collected
    over the area using the NASA Airborne Topographic Mapper (ATM), a scanning lidar
    system that measures high-resolution topography of the land surface. The ATM system
    is deployed on a Twin Otter or P-3 Orion aircraft and incorporates a green-wavelength
    laser operating at pulse rates of 2 to 10 kilohertz. Measurements from the laser-ranging
    device are coupled with data acquired from inertial navigation system (INS) attitude
    sensors and differentially corrected global positioning system (GPS) receivers to
    measure topography of the surface at accuracies of +/-15 centimeters. This dataset
    contains vectorized shorelines created from data acquired from Breton Island, Louisiana.
    Shorelines were vectorized in ArcMap 10.2.2 so they could be used for area and shoreline
    change analysis, using the Digital Shoreline Analysis System (DSAS) Version 4.0.",nt"license_title":
